import { useEffect, useState } from "react"
import { getPosts } from "../posts"

export function PostList() {
    const [posts, setPosts] = useState([])
    useEffect(() => {
        getPosts().then(setPosts)
    }, [])
    return <h1>{JSON.stringify(posts)}</h1>
}
